  return (
    <div>
        <BrowserRouter>

<div style={{ backgroundColor: '#999999' }}>
    <Header
        ref='headerLayer'
        loggedIn={this.state.loggedIn}
        loggedOut={this.loggedOut}
    />
    <hr className="hr1" />
    {/* <Route path='/' component={Content}  /> */}
    <Content
        ref='contentLayer'
        callLogoutButton={this.callLogoutButton}
    />
    <hr className="hr2" />
    <Footer />
</div>

</BrowserRouter>
    </div>
  );
}

export default App;
